title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o20080.m18 -> o20090.m8 -> o20080.m18
  o20090.m16 -> o20080.m18 -> o20090.m8 -> o20080.m18
  o20090.m19 -> o20090.m1 -> o20080.m10 -> o20090.m19
  o20080.m10 -> o20090.m19 -> o20090.m1 -> o20080.m10
  o20090.m6 -> o20080.m18 -> o20090.m8 -> o20080.m18
  o20090.m8 -> o20080.m18 -> o20090.m8
  o20090.m1 -> o20080.m10 -> o20090.m19 -> o20090.m1

features:
  - inheritance
  - overriding
  - method
  - polymorphism

